import { ScrollView, View } from 'react-native';
import { Appbar, Card, Text, ProgressBar, Button, FAB, List } from 'react-native-paper';

export default function KelasScreen({ navigation }) {
	return (
		<>
			<Appbar.Header>
				<Appbar.BackAction onPress={() => navigation.goBack()} />
				<Appbar.Content title="Akademi Bank Sampah" />
			</Appbar.Header>

			<Button icon="plus" mode="contained" onPress={() => navigation.navigate('CariKelasScreen')} style={{ margin: 10 }}>Gabung Kelas</Button>
		</>
	);
}
